window.bookSummaryJSON = "<p><b>It's never been the right time for my mates and me. They had their dream of running a coffee shop in Ever, and I had mine climbing the career ladder at monster headquarters. Ambition has kept us apart for centuries.</b></p> <p>When a work assignment brings me to their haven, proximity reinforces how much we long to complete our bond and remain together permanently.</p> <p>I come up with a radical idea to pitch to monster headquarters, an idea that'll solve not only my long-distance relationship problem, but the same problem for thousands of other monsters. But first, I have to convince my evil boss of the benefits to my plan. If I can't get her on board, I could lose more than my job. Pietro and Alessandro tire of us being apart. They want full-time commitment. They deserve happiness.</p> <p>It's now or never for our love. Wish me luck.</p> <p>Victory for Vampires <i>is an MMF novella set in the world of Haven Ever After. It takes place after the events of book four, but doesn't need to be listened to in any particular order to be enjoyed.</i></p>"; 
